import "./App.css";
import { BrowserRouter, Routes, Route, useParams } from "react-router-dom";

import Login from "./pages/Login";
import CommunityList from "./pages/ CommuityList";
import Community_Create from "./pages/Community_Create";
import SignUp from "./pages/SignUp";
import Community from "./pages/Community";

const dummylist = [
  {
    id: 1,
    community_name: "지수그룹",
    community_picture: "이쁜사진",
    community_allow: "허용",
    create_date: new Date().getTime(),
  },
  {
    id: 2,
    community_name: "수연그룹",
    community_picture: "이쁜사진2",
    community_allow: "허용",
    create_date: new Date().getTime(),
  },
  {
    id: 3,
    community_name: "지원그룹",
    community_picture: "이쁜사진3",
    community_allow: "허용",
    create_date: new Date().getTime(),
  },
];

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path="/login" element={<Login />} />
          <Route path="/signUp" element={<SignUp />} />
          <Route path="/communitylist" element={<CommunityList />} />
          <Route path="/community/:id" element={<Community />} />
          <Route path="/community_create" element={<Community_Create />} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
